import React from "react";

function Navbar() {
  return (
    <nav>
      <ul className="flex flex-row">
        <li>Home</li>
        <li>
          <li>Github</li>
          <li>LinkedIn</li>
          <li>Twitter</li>
        </li>
        <li>Contact</li>
      </ul>
    </nav>
  );
}

export default Navbar;
